var tipuesearch = {"pages":[{"text":"2016Fall 修課成員網誌","url":"./pages/about/","title":"About","tags":"misc"},{"text":"第八周 本日上課須個人小組自評 本日上課組員9人 40423143 40423147 40423146 40423123 40423141 40423124 40423120 40423114 40423154 本周任務:個人和小組自評,補齊前面幾周小組和個人缺的零件和導入v-rep的操作影片過程 40423146 8連桿導入v-rep操作影片 ONSHAPE零件操作 40423143 ONSHAPE零件組合 40423143 第一段","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-ba-zhou.html","title":"協同產品設計實習 第八周","tags":"seat table"},{"text":"第七周 本日上課組員7人 40423143 40423147 40423146 40423123 40423141 40423124 40423120 本周任務:須補齊前面幾周小組和個人缺的零件和導入v-rep的操作影片過程 是的沒錯大家都很努力在趕進度,很棒所以大家都70分","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-qi-zhou.html","title":"協同產品設計實習 第七周","tags":"seat table"},{"text":"第六周 本日上課組員7人 40423143 40423147 40423146 40423123 40423141 40423124 40423120 導入v-rep 40423143 零件繪製 40423143 導入v-rep 40423146 ONSHAPE零件操作 40423143 ONSHAPE零件組合 40423143 第一段 ONSHAPE零件組合 40423143 第二段","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-liu-zhou.html","title":"協同產品設計實習 第六周","tags":"seat table"},{"text":"第五周 上課心得: 補齊前面的作業跟架構 Fossil SCM的首頁,心得上需要更明確表達意思和工作內容 本日上課組員7人 40423143 40423147 40423146 40423123 40423141 40423124 40423120 第七組FOSSIL SCM連結: https://mde2a2.kmol.info/cdag7/home Fossil SCM 是一套軟體配置管理 (Software Configuration Management) 系統, 其中包含分散式版次控管 (DVC, Distributed Version Control) 、Wiki 、Bug Tracking 與 Technote 等功能, 可以用來控制及追蹤軟體開發專案, 並且紀錄專案開發歷程, 在協同產品設計實習課程中, 我們除了使用 git、github 與 bitbucket 之外, 將要在區域網路與系上主幹中, 配置每班兩台的 Fossil SCM 實習主機. 導入v-rep 40423146","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-wu-zhou.html","title":"協同產品設計實習 第五周","tags":"seat table"},{"text":"第四周 上課心得:新架構,新體驗 本日上課組員5人 40423143 40423147 40423146 40423123 40423141 第七組FOSSIL SCM連結: https://mde2a2.kmol.info/cdag7/home Fossil SCM 是一套軟體配置管理 (Software Configuration Management) 系統, 其中包含分散式版次控管 (DVC, Distributed Version Control) 、Wiki 、Bug Tracking 與 Technote 等功能, 可以用來控制及追蹤軟體開發專案, 並且紀錄專案開發歷程, 在協同產品設計實習課程中, 我們除了使用 git、github 與 bitbucket 之外, 將要在區域網路與系上主幹中, 配置每班兩台的 Fossil SCM 實習主機. 心得:當組長應把工作分配好","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-si-zhou.html","title":"協同產品設計實習 第四周","tags":"seat table"},{"text":"第三周 上課筆記:觀看上課影片並進行翻譯,和完成4連桿的模擬 ##影片翻譯 影片二 翻譯人:40423141 內容: The 2017 HyperWorks release has a lot 在2017年HyperWorks發行很多版本 of enhancements to the modeling and assembly capabilities 對軟件的建模和組裝能力的增強 So we put in a new parts browser with a built-in part library 所以我們在一個新的零件瀏覽器與一個內置零件庫 The part library is a great tool for storing and loading work in progress 零件庫是用於存儲和加載正在進行工作的一個很好的工具 So you can store a catalog of all the common parts 因此，您可以存儲所有公共部分的目錄 that a workgroup needs to use,so they can download their models from their PLM system 工作組需要使用，因此他們可以從他們的PLM系統下載他們的模型 and store them locally in a parts library for a work in progress 並將它們本地存儲在正在進行的工作的零件庫中 And it keeps revision control on them, 他保持對它們的修訂控制 so they can back up to the different versions and reload. 所以他們可以備份到不同的版本並重新加載。 And they can also build different configurations now of their models. 他們也可以建立不同的配置到他們現在的的模型。 In the configuration modeler now 現在在配置建模器 they can import parts from part library and then group 他們可以從零件庫導入零件然後分組 them into what we call part sets,which are 他們變成我們所說的部分集 convenient groupings of parts. 即零件方便分組 And then they can drag those parts together into assemblies, 然後他們可以將這些部分一起拖入組件 and configure them for different load 並為不同負載配置它們的 cases or different variations of their models. 情況或他們的模型的不同變化 the other feature of haveing parts in the software 硬件部分的軟件中的另一個特點 is we do part instancing now,too. 我們現在也做實例化 So if you load in a part that has 所以如果你加載在一個部分 multiple instances through the model,we support that. 我們支持多個實例通過模型 We don't have to create multiple copies of it. 我們不必創建它的多個副本 We can actually do the instancing,which is very memory efficient. 我們可以做實際，這是非常有效的記憶。 Also in the model building assembly 也在模型建築組裝 tool set is enhanced ID management as well. 工具集也是增強的ID管理 So not only can we assign IDs based on different rules 因此，我們不僅可以根據不同的規則分配ID that you define in the software,but you can import ID systems 您可以在軟件中定義，但可以導入ID系統 form spreadsheets,XML files,databases, 形式電子表格，XML文件，數據庫， and so forth,that are then used when 等等，然後在使用 it does the renumbering or the assembly of the model. 它進行重新編號或模型的組裝 it has to resolve part collisions. 它必須解決部分碰撞。 Really important part of doing model assembly 做模型組裝重要的部分 is connecting all those parts together. 將所有這些部分連接在一起 Connectors are really vital to the overall assembly process. 連接器對整個裝配過程至關重要。 The quality of the connector that you create really 您真正創建的連接器的質量 determines the outcome of the quality 確定質量的結果 of the overall assembled model as well. 對整體組裝模型 So for us to get a good high fidelity solution, 所以為我們得到一個良好的高保真度解決方案 you have to have a really good connection generation as well. 你必須有一個非常好的連接生成 翻譯心得:這是由英文很強的組員翻的,是有嘗試去聽但聽不是很懂","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-san-zhou.html","title":"協同產品設計實習 第三周","tags":"seat table"},{"text":"第二周 第一週課程簡報 1.利用ipconfig /all查詢 IPv4 位址,接著使用SciTE開啟stunnel/config/stunnel.conf,修改accept的ip位址 SolveSpace零件一 繪製者:40423143 SolveSpace零件二 繪製者:40423143 SolveSpace零件三 繪製者:40423143 SolveSpace零件組合 繪製者:40423123","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-er-zhou.html","title":"協同產品設計實習 第二周","tags":"seat table"},{"text":"設計二甲座位表 seet 第二組組長:40423143 楊智勝 組員40423114 組員40423141 組員40423120 組員40423154 組員40423147 組員40423114 組員40423124 組員40423146","url":"./she-ji-er-jia-zuo-wei-biao.html","title":"設計二甲座位表","tags":"seat table"},{"text":"上課筆記 1.分組(如何更有效分組) 2.利用solvespace及onshape組裝四連桿機構ipcofig設定 3.要主動教導不會的同學","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-yi-zhou.html","title":"協同產品設計實習 第一周","tags":"PPT"}]};